style.css:
/* Estilo para o corpo do documento */
body {
    font-family: Arial, sans-serif;
    background-color: #f0f0f0;
    color: #333;
}

/* Estilo para os cabeçalhos */
h1, h2, h3 {
    color: #007bff;
}

/* Estilo para links */
a {
    color: #007bff;
    text-decoration: none;
}

a:hover {
    text-decoration: underline;
}

/* Estilo para caixas de texto */
input[type="text"], textarea {
    padding: 5px;
    border: 1px solid #ccc;
    border-radius: 3px;
    outline: none;
}

/* Estilo para botões */
button {
    padding: 8px 16px;
    background-color: #007bff;
    color: #fff;
    border: none;
    border-radius: 3px;
    cursor: pointer;
}

button:hover {
    background-color: #0056b3;
}
